import React from "react";
import "./styles/About.css";
import { Link } from "react-router-dom";

export default function About() {
  return (
    <div className="about_container">
      <Link to={`/home`}>
        <button className="btnNav">Return</button>
      </Link>
      {/* <img src="./imagenes/nicole.png" alt="" /> */}

      <p>
        Hi! My name is Nicole! I'm the creator of this page, here you can find
        Rick & Mortys' characters, you could search for them by their ID also
        you can check for extra information if you click on the characters'
        names!
      </p>
    </div>
  );
}
